import React from "react";
import "./LandingPage.css";

const LandingPage = () => {
  return (
    <div className="landing-container">
      {/* Navbar */}
      <nav className="navbar">
        {/* Left links */}
        <ul className="nav-left">
          <div className="logo">Advanced To Do</div>
          <li className="active">HOME</li>
          <li>DASHBOARD</li>
          <li>EMPLOYEES</li>
          <li>DEPARTMENTS</li>
        </ul>

        {/* Right buttons */}
        <div className="nav-right">
          <button className="login-btn">LOGIN</button>
          <button className="signup-btn">SIGNUP</button>
        </div>
      </nav>

      {/* Hero Section */}
      <div className="hero-section">
        {/* Left Text */}
        <div className="hero-text">
          <h1>
            <span>stay organized,</span> <br />
            <span>stay focused,</span> <br />
            <span>achieve your goals effortlessly!</span>
          </h1>
          <p>
            Manage tasks, set deadlines, <br />
            and get <strong>smart reminders</strong> â€” making{" "}
            <strong>productivity simple and effective!</strong>
          </p>
          <button className="dashboard-btn">Dashboard</button>
        </div>

        {/* Right Background Image */}
        <div className="hero-image"></div>
      </div>
    </div>
  );
};

export default LandingPage;
